import React from "react";
import { Link } from "react-router-dom";

function Navbar() {
  return (
    <nav className="navbar">
      <h1>언어 트렌드 분석</h1>
      <div className="links">
        <Link to="/">홈</Link>
        <Link to="/trends">실시간 언어 트렌드</Link>
        <Link to="/prediction">언어 예측</Link>
      </div>
    </nav>
  );
}

export default Navbar;
